import styles from "../components/UI/Welcome.module.css"

const Welcome = () => {
  const hour = new Date().getHours();
  let message = "";

  if (hour >= 0 && hour < 12) {
    message = "Good Morning!";
  } else if (hour >= 12 && hour <= 18) {
    message = "Good Afternoon!";
  } else {
    message = "Good Evening!";
  }

  return (
    <div className={styles.wrapper}>

      <div className={styles.scroll}>
        <h3>
          {message}
        </h3>
      </div>

      <div className={`${styles.fixed} ${styles.one}`}></div>

      <div className={styles.scroll}>
        <h3>
          "There's nothing more beautiful than the way how the ocean refuses to
          stop kissing the shoreline, no matter how many times it's sent away."
        </h3>
      </div>

      <div className={`${styles.fixed} ${styles.two}`}>

      </div>

      <div className={styles.scroll}>
        <h3>
          "So that the monotonous fall of the waves on the beach, which for the
          most part beat a measured and soothing tattoo to her thoughts seemed
          consolingly to repeat over and over again."
        </h3>
      </div>

      <div className={`${styles.fixed} ${styles.three}`}></div>

    </div>
  );
};

export default Welcome;
